import React, { useState } from 'react';

const test = () => {

    const [rows, setRows] = useState([]);

    const api = 'https://127.0.0.1/'

    fetch(api)
    .then((res) => res.json())
    .then((data) => setRows(data));
    return (
        <div>
            This is data {rows}
        </div>
    )
}

export default test
